import React, { useEffect, useState } from 'react'
import './Leaderboard.css';


function Leaderboard() {


    useEffect(() => {
        fetch('/get_data').then(response => {
            if(response.ok) {
                return response.json()
            }
        }).then(data => {
            localStorage.setItem("studentData", data)
        })
    })

    studentData = localStorage.getItem("studentData")

    return (
        <div className="leaderboard">
            <table id="example" class="table table-striped table-bordered" style={{width:"100%"}}>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Roll Number</th>
                        <th>Maths</th>
                        <th>Physics</th>
                        <th>Chemstry</th>
                        <th>Total</th>
                        <th>Percentage</th>
                    </tr>
                </thead>
                <tbody>
                {studentData.map(student => (
                    <tr key={student.roll_no}>
                        <td>{student.name}</td>
                        <td>{student.roll_no}</td>
                        <td>{student.maths_score}</td>
                        <td>{student.physics_score}</td>
                        <td>{student.chemestry_score}</td>
                        <td>{student.total}</td>
                        <td>{student.percentage}</td>
                    </tr>
                    ))}
                </tbody>
                <tfoot>
                    <tr>
                        <th>Name</th>
                        <th>Roll Number</th>
                        <th>Maths</th>
                        <th>Physics</th>
                        <th>Chemestry</th>
                        <th>Total</th>
                        <th>Percentage</th>
                    </tr>
                </tfoot>
                </table>
        </div>
    )
}

export default Leaderboard;
